■商品名：本革ハンドメイド イヤホンコードホルダー<br> <br> ■スペック<br> ・革の素材： グローブレザー(牛革オイルレザー) <br> ・金具の素材： 真鍮製(クラウンブランド・日本製) <br> ・組立時のサイズ： 横：約4.8cm、縦の長さ：約3cm 厚み：約1cm　/ 革の厚み：約2mm <br><br>■注意事項<br>
・『メール便をご希望の場合、代金引換は対応不可』となります。<br>
(※代金引換をお選び頂きました場合、別途通常の送料を加算させて頂きます。) <br><br>・メール便の対象商品以外と同時にご注文頂きました場合、<br>同時にご注文商品の送料及び、通常の送料表の料金を加算させて頂きます。 <br><br> ・メール便の対象商品を複数のご購入により、<br>メール便のサイズ規格外となりました場合、<br>通常の宅配便(送料無料)にて発送させて頂きます。<br><br>■配達につきまして<br> ・メール便(ゆうパケット)はポスト投函にて配達いたします。追跡可。日時指定不可。コンビニ受け取り不可。<br> (配達後、盗難などの保証なし)<br> ・概ね差出日の翌日～翌々日にお届け予定。<br>(※遠方、離島地域などを除く。)<br>※画像のイヤホンは付属いたしません。<!--▼縦バナーのCSS▼-->
